commits.content:
body{
    font-family: Roboto, sans-serif;
    font-size: 16px;
    margin:auto;
    padding: 0;
    max-width: 1400px;
}
h1{
    font-family: Shrikhand, sans-serif;
    font-size: 50%;
    font-weight: 700;
    line-height: 1.1;
    text-align: center;
    padding: 20px;
}
h2{
    padding: 20px;
    font-size: 150%;
}
h3, p{
    padding-left: 20px;
}
h4{
    font-family: Shrikhand, sans-serif;
    font-size: 30px;   
}
h5{
    text-transform: uppercase;
    font-size: 130%;
    font-weight: 100;
    padding-left: 15px;
    padding-bottom: 22px;
    margin-top: 20px;
}
h6{
    font-size: 100%; 
    font-weight: 600;
}
ul{
    list-style-type: none;
    text-decoration: none;
}
a{
    text-decoration: none;
    color: #000;
}
